static void
gpio_setup(void)
{
   /* Enable GPIOC clock. */
   rcc_periph_clock_enable(RCC_GPIOA);
   rcc_periph_clock_enable(RCC_GPIOB);

   /* Set GPIO8 (in GPIO port C) to 'output push-pull'. */
   gpio_mode_setup(GPIOA, GPIO_MODE_OUTPUT, GPIO_PUPD_NONE, GPIO7);
   gpio_mode_setup(GPIOB, GPIO_MODE_AF, GPIO_PUPD_NONE, GPIO3);
   gpio_set_af(GPIOB, GPIO_AF0, GPIO3);
}

static void
task1(void *args __attribute((unused)))
{
    struct display_driver display;
    uint16_t color = 1;
    display_init(&display, displayOrientationHorizontalFlipped);
	display_clear(&display, 0x0220);
    for (;;) {
        vTaskDelay(pdMS_TO_TICKS(600));
        color = color << 1;
        if (!color)
        {
            color = 1;
        }
        display_clear(&display, color);
        vTaskDelay(pdMS_TO_TICKS(100));
        struct display_area axes_are = {.xStart = 20, .yStart = 40, .xEnd = 140, .yEnd = 160};
        display_write_image(&axes_are, axes_image);
        gpio_toggle(GPIOA, GPIO7);
    }

}

